// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './component/Home';
import CoffeeList from './component/CoffeeList'; // Pastikan import ini ada
import CoffeeDetail from './component/CoffeeDetail';
import About from './component/About';
import Contact from './component/Contact';
import Navbar from './component/Navbar'; // Import Navbar

function App() {
  return (
    <Router>
      <Navbar /> {/* Tambahkan Navbar di sini */}
      <Route>
        <Route path="/" exact component={<Home />} />
        <Route path="/coffees" component={<CoffeeList />} /> {/* Pastikan path ini sesuai */}
        <Route path="/coffee/:id" component={<CoffeeDetail />} />
        <Route path="/about" component={About} />
        <Route path="/contact" component={Contact} />
      </Route>
    </Router>
  );
}

export default App;
